iel 12.24. Ezequiel 13.6-7. Ezequiel 22,28. Miqueias 3.6-7. Zacarias 10.2. E o texto mais importante, neste contexto, é Atos 16.16-18, espírito de adivinhação é um espírito maligno e não provém de Deus;<br>3. Por fim, todo o cristão autêntico, que acredita no amor e na verdade se baseará nos princípios bíblicos para fazer escolhas. No caso das eleições, por exemplo, só Jesus pode nos fazer enxergar a verdade, porque sabemos que muitos cristãos serão enganados, só que é importante ressaltar que nunca foram cristãos de verdade (Mateus 7.21). João 14.6, diz que Jesus é o Caminho e a Verdade e a Vida, ou seja, só Jesus pode nos guia em meio a mentiras, nos revelar a verdade e assim alcançarmos a vida eterna; quem está fora Dele não consegue fazer boas escolhas, sequer consegue enxergar seus próprios pecados, admiti-los, confessá-los e se arrepender diante da Soberana, Santa e Poderosa presença de Deus.<br><br>Que o SENHOR abra os nossos olhos para que possamos enxergar aquilo que Ele quer que enxerguemos, que sejamos submissos à sua vontade (Deus) e que Ele mesmo alinhe os nossos corações (dos seus verdadeiros filhos) ao seu coração, em nome de Jesus. Amém!', 'textOriginal': 'Deus me despertou para a leitura das sagradas escrituras, desde os meus quatro anos de idade. Hoje tenho quarenta e três e sou despertada todas as manhãs pelo Espírito Santo para a oração e o estudo da bíblia. Sendo assim, hoje acordei por volta das 05h00 para orar e estudar a palavra de Deus, e costumo acessar o Youtube a fim de escolher um louvor de acordo com o tema. De repente, o Youtube me sugeriu o vídeo supra "Pastor explica por que Bolsonaro é anticristo e estranha apoio de evangélicos". Então segui com o meu propósito de oferecer culto ao SENHOR e sai de casa, posteriormente. Contudo esse assunto ficou em minha mente. Assim que cheguei fui refletir sobre o tema e então peguei a minha Bíblia. Sendo assim, vamos tratar o assunto por parte: 

